function filter(e,o,l,t){let s=document.querySelector("#"+e).value;s.length>0?document.querySelector("#"+o).classList.remove("hidden"):document.querySelector("#"+o).classList.add("hidden");let n=document.querySelector(l).querySelectorAll(t);for(let e=0;e<n.length;e++)n[e].textContent.toLowerCase().includes(s.toLowerCase())||n[e].outerText.toLowerCase().includes(s.toLowerCase())?showBlock(n[e]):hideBlock(n[e])}function showBlock(e){e.classList.remove("hidden")}function hideBlock(e){e.classList.add("hidden")}function clearFilter(e,o,l,t){document.querySelector("#"+e).value=null,filter(e,o,l,t),document.querySelector("#"+e).select()}function escapeSearch(e,o,l,t,s){27==e.keyCode&&clearFilter(o,l,t,s)}function toggleTr(e,o){$(o).hasClass("fa-chevron-down")?($(o).removeClass("fa-chevron-down"),$(o).addClass("fa-chevron-up")):($(o).removeClass("fa-chevron-up"),$(o).addClass("fa-chevron-down")),$(e).slideToggle();try{$("html, body").animate({scrollTop:$(o).offset().top-150},500)}catch(e){}}function toggleTrs(e,o,l){$(l).hasClass("fa-chevron-down")?($(l).removeClass("fa-chevron-down"),$(l).addClass("fa-chevron-up")):($(l).removeClass("fa-chevron-up"),$(l).addClass("fa-chevron-down")),$(e).slideToggle(),$(o).slideToggle();try{$("html, body").animate({scrollTop:$(l).offset().top-150},500)}catch(e){}}function hideElement(e){showLoader(),$(e).hide()}function showLoader(){$("#loader").show()}